import React from "react";

function Header() {
  return (
    <header style={{ backgroundColor: "#4dabf7", padding: "10px", color: "white" }}>
      <img 
        src={weather-con} 
        alt="Weather Icon" 
        style={{ width: "40px", height: "40px", marginRight: "10px" }} 
      />
      <h1>My Weather App</h1>
    </header>
  );
}

export default Header;
